INSERT INTO `Event` (`eid`, `gid`, `etime`, `elocation`, `edescription`, `ecuid`, `etitle`) VALUES
(1, '584e180c633c6', '2016-12-13 11:00:00', '270 10th St, Jersey City', 'Szechwan Shrimp. Kung Pao Chicken. Spicy Crispy Beef. Sweet and Sour Pork. Get top recipes for the Chinese recipes you crave.', 9, 'Chinese food'),
(2, '58509a73c684d', '2016-12-21 00:22:00', ' Directions Bobst Library 70 Washington Squar', 'Geeks Who Drink is a pub quiz with eight rounds of eight questions each, including a music round, an audio round, and a picture round. Free to play, with prizes for the top two teams and bonus prizes throughout the game.  Every Wednesday.', 7, 'Christmas Party '),
(3, '58509b3a8868b', '2016-12-29 14:02:00', '325 Grove St.  Jersey City, NJ 07302', 'The Historic Downtown Jersey City Farmersâ€™ Market features various NJ and NY metro area farmers, bakeries and artisan food, health and beauty goods.', 7, 'Farmers Party!'),
(4, '58509ce9d4f5e', '2017-01-25 13:03:00', '23 E 26th St, New York, NY 10016', 'Most of us donâ€™t have the time to make a Pinterest-perfect Gingerbread house. Iâ€™d love to â€“ but I am stressed just thinking about the construction of those cookie walls, and the sticky mess in the kitchen. Letâ€™s just say Iâ€™m still having flashbacks from previous Christmas baking projects. Instead, I will be keeping it simple this year, with easy festive treats that are kid-proof and wonâ€™t have me reaching for the extra eggnog.', 9, 'Super Easy and Cute Christmas Treats');
INSERT INTO `GGroup` (`gid`, `gname`, `cuid`, `gdescription`) VALUES
('584e180c633c6', 'Wash Dish Club', 9, 'we create the most delicious food!'),
('58509a73c684d', 'Homemade Cake', 7, 'Join us to share ways to cook delicious cake!!!'),
('58509b3a8868b', 'Historic Downtown Jersey City Farmers Market ', 7, 'The Historic Downtown Jersey City Farmersâ€™ Market features various NJ and NY metro area farmers, bakeries and artisan food, health and beauty goods.'),
('58509ce9d4f5e', 'I made it!!!', 8, 'Welcome to I Made It II! I am now the moderator and we found it easiest to just start a whole new group, so here we are :) This is a place you come to post and review recipe s that you have tried of members here on Grouprecipes. Start a new thread for each recipe by typing the recipe name into the title. Please leave recipe links so we can find it easy and we love pictures added to the threads as well, if you can, but no pressure :) Just have fun and hope this turns out successful!!'),
('58509e905a8e1', 'Our daily dinner', 8, 'Please add the recipes you make for your daily dinner, share the warmth of your family table, either for one or twenty!');
