INSERT INTO `Recipe` (`rid`, `uid`, `rtitle`, `rserving`, `rdescription`) VALUES
('584dfbba75601', 7, 'Asian Orange Chicken', 4, 'A delicious citrus chicken recipe with flavors reminiscent of the orange chicken from a popular restaurant in the mall.A delicious citrus chicken recipe with flavors reminiscent of the orange chicken from a popular.'),
('584e015131bff', 7, 'Sesame Pasta Chicken Salad', 10, 'A refreshing light pasta salad with a delicious Asian flair. Great for a summer cookout or picnic. Tastes great right away, and even better if you can allow it to marinate for a while.'),
('584e04536f384', 7, 'Chinese Pepper Steak', 4, 'A delicious meal, served with boiled white rice, that''s easy and made from items that I''ve already got in my cupboards! My mother clipped this recipe from somewhere and it became a specialty of mine, mine of spice.'),
('584e0544b0900', 7, 'Miso Soup', 4, 'Dashi is a basic stock used in Japanese cooking which is made by boiling dried kelp (seaweed) and dried bonito (fish). Instant dashi granules are sold in conveniently-sized jars or packets and vary in strength. '),
('584e060717bea', 7, 'Spicy Orange Beef', 4, 'This stir-fry is a good weekday dinner recipe. It can be made in about the time it takes to make a pot of rice to serve with it.It can be made in about the time it takes to make a pot of rice to serve with it.'),
('584e0eef8bf52', 8, 'Maharaja Curry', 4, 'This is a really nice Indian recipe, taught to me by an elderly Indian lady, who used to cook for all her family. It is a simple recipe and tastes lovely served with rice. You can also use mutton instead of chickenã€‚'),
('584e0fc1c7d77', 8, 'Red Lentil Curry', 8, 'This is a rich and hearty lentil curry, great as a main meal rather than as a side dish like the more traditional Indian dhal. Don''t let the ingredient list faze you, this really is an easy dish to make. This dish.'),
('584e142dd8158', 9, 'Italian Sausage', 6, 'My family has been using this very simple and delicious recipe for sausage, peppers, and onions for years and years now. For an extra.'),
('584e153301bd8', 9, 'World''s Best Lasagna', 12, 'It takes a little work, but it is worth it.This was perfect. Easy and quick to make I did not use cabbage added brocolli and thinly sliced carrots. Stir fried it all in the wok and served over sticky rice, sticky rice,sticky rice,sticky rice.'),
('584e15d97e67d', 9, 'Jay''s Signature Pizza Crust', 5, 'This recipe yields a crust that is soft and doughy on the inside and slightly crusty on the outside. Cover it with your favorite sauce and topping to make a delicious pizza.'),
('5852fc1b8a865', 7, 'Honey-Garlic Chicken Thighs', 4, 'I have used it often. It''s easy and uses pantry staples. Always a hit with adults and kids. Serve with basmati rice or quinoa and steamed or roasted vegetables.');
