INSERT INTO `Review` (`r_id`, `rid`, `uid`, `rrate`, `rtext`, `rvtitle`) VALUES
('584ebdde78b5c', '584e142dd8158', 7, 5, 'This was perfect. Easy and quick to make I did not use cabbage added brocolli and thinly sliced carrots. Stir fried it all in the wok and served over sticky rice', 'This is perfect!'),
('5852fcbb66235', '5852fc1b8a865', 7, 1, 'Too salty!!!!', 'Not that good.'),
('5853022059700', '584e0544b0900', 7, 5, 'The sauce was way, way too sweet. And 2 tablespoons of cornstarch was way too much. A tablespoon would''ve been plenty. Also, a true stir fry would brown the chicken, take the chicken out of the pan, then cook the onion and other vegetables. After the veggies are done, that''s when you''d add the chicken back in so you don''t end up with overcooked chicken.', 'Great!'),
('5853025523b5e', '584dfbba75601', 7, 5, 'This is my favorite recipe that I have found at allrecipes.com - I fell in love with it when I was making (and tasting) the sauce! The sauce is AMAZING and so delicious, really to die for, and it *makes* the dish.', 'My favorite!'),
('585302bbbeeff', '584dfbba75601', 7, 5, 'This is my favorite recipe that I have found at allrecipes.com - I fell in love with it when I was making (and tasting) the sauce! The sauce is AMAZING and so delicious, really to die for, and it *makes* the dish.', 'Delicious!!!'),
('58530311bf936', '584e015131bff', 7, 4, 'I''ve received many compliments on this recipe, having served it a few times. I would only alter a few things: add julienned carrots, sliced water chestnuts and pea pods cut in half on an angle- really adds nice color, texture and flavor.', 'I love this recipe.'),
('585304e167c6e', '584e04536f384', 7, 3, 'A delicious meal, served with boiled white rice, that''s easy and made from items that I''ve already got in my cupboards! My mother clipped this recipe from somewhere and it became a specialty of mine, mine of spice.', 'Not that good.'),
('585304ffae385', '584e060717bea', 7, 4, 'Even my son liked this(and he says he doesn''t like onions). I used about half the green onions and regular onions that this recipe called for. I also used about a 1/2 tsp of ground ginger instead of the fresh ginger. Good basic stir fry.', 'My son like this.'),
('5853051d1da2e', '584e0eef8bf52', 7, 3, 'Great recipe! I used candy canes instead. I also halved the peppermint extract based on other reviews and I wish I hadn''t. Next time I will use all of the peppermint extract and put it in the white chocolate layer only. Also, I only put the semisweet layer in the freezer while I melted the white chocolate and I didn''t have any problems with them separating when I broke it apart. I will make this again!', 'Not Bad!'),
('58530547117b2', '584e0fc1c7d77', 7, 5, 'I have never sent a review for any recipe that I have tried. But, this recipe deserves one! It is excellent. I used fresh tomatoes and then put them into the caramelized onions. I also simmered all the spices together in a little oil, as taught to me by an Indian cook. Then, tossed in the garlic and ginger; continued for about 1 more minute. Afterwards, I put the tomato and onions into the spice mix. Then, added the lentils... AWESOME!', 'Taste Good!'),
('58530562c828e', '584e142dd8158', 7, 4, 'This was perfect. Easy and quick to make I did not use cabbage added brocolli and thinly sliced carrots. Stir fried it all in the wok and served over sticky rice', 'So great!'),
('5853058f05420', '584e15d97e67d', 7, 5, 'This was perfect. Easy and quick to make I did not use cabbage added brocolli and thinly sliced carrots. Stir fried it all in the wok and served over sticky rice', 'Perfect'),
('585305adb1e01', '584e153301bd8', 7, 5, 'This was perfect. Easy and quick to make I did not use cabbage added brocolli and thinly sliced carrots. Stir fried it all in the wok and served over sticky rice', 'This is perfect!'),
('585308ad79536', '584dfbba75601', 8, 1, 'Following the instruction and ingredients, the foot tastes bad. ', 'I dont like this recipe....'),
('585308dd59cc2', '584e015131bff', 8, 4, ' I would only alter a few things: add julienned carrots, sliced water chestnuts and pea pods cut in half on an angle- really adds nice color, texture and flavor.', 'Highly Recommend!'),
('585308f860e1b', '584e04536f384', 8, 2, 'A delicious meal, served with boiled white rice, that''s easy and made from items that I''ve already got in my cupboards! My mother clipped this recipe from somewhere and it became a specialty of mine, mine of spice.', 'Not that good.'),
('5853091740b07', '584e0544b0900', 8, 5, 'The sauce was way, way too sweet. And 2 tablespoons of cornstarch was way too much. A tablespoon would''ve been plenty. Also, a true stir fry would brown the chicken, take the chicken out of the pan, then cook the onion and other vegetables. After the veggies are done, that''s when you''d add the chicken back in so you don''t end up with overcooked chicken.', 'Greet'),
('5853092da3577', '584e060717bea', 8, 4, 'Even my son liked this(and he says he doesn''t like onions). I used about half the green onions and regular onions that this recipe called for. I also used about a 1/2 tsp of ground ginger instead of the fresh ginger. Good basic stir fry.', 'My son like this.'),
('58530abd85066', '584e15d97e67d', 8, 4, 'I love pizza', 'I love this recipe.'),
('58530b2936462', '5852fc1b8a865', 8, 5, 'Delicious!!!!!', 'SO delicious!'),
('58530b6de997b', '584dfbba75601', 9, 5, 'This is my favorite recipe that I have found at allrecipes.com - I fell in love with it when I was making (and tasting) the sauce! The sauce is AMAZING and so delicious, really to die for, and it *makes* the dish.', 'Delicious!!!'),
('58530c00ccd59', '584e015131bff', 9, 1, 'I am sure this recipe is not that good, you can try if you like!', 'Taste bad!'),
('58530c30b8542', '584e04536f384', 9, 5, 'I really like this recipe.', 'I like it!'),
('58530eb967091', '584e0eef8bf52', 9, 4, 'I only put the semisweet layer in the freezer while I melted the white chocolate and I didn''t have any problems with them separating when I broke it apart. I will make this again!', 'Great Experience'),
('58530f4d12ec0', '584e15d97e67d', 9, 1, 'Actually, I am king of disappoint after I tried this recipe. It seems great but thats not truth.', 'So disappointed!'),
('585310a431be0', '584dfbba75601', 9, 3, 'see photo', 'Post Photo');
